import React from 'react';

import Hero from '../components/Hero';
import Content from '../components/Content';

function AboutPage(props) {
    const downloadMessage = "Download a PDF of my {<a href='https://drive.google.com/file/d/1-pRAr78uW9v78C29tuOPyQXWrNPQs0eq/view?usp=sharing' target='_blank' rel='noreferrer' className='default'>}Professional Resume</a> or <a href='https://drive.google.com/file/d/1e-ACTyMqLo_neKqfUbgBYhQwGw_DjD7e/view?usp=sharing' target='_blank' rel='noreferrer' className='default'>Creative Resume</a>.";
    return (
        <div>
            <Hero title={props.title} subTitle={downloadMessage}/>
            <Content>
                <hr class="rounded" />

                <p className="paragraph">
                        <h2>
                            Problem
                        </h2>
                        Young adults may often feel like they are trapped inside a small bubble within their local communities. They may not feel as well connected with issues and events happening in the rest of the country or world. This includes a wide variety of topics including health, modern films, injustice, ethics, and more.
                    </p>
            </Content>
        </div>
    );
}

export default AboutPage;
